import MyContext from './MyContext';

class MyProvider extends Component {
    state = {
        market_data: []
    }

    render() {
        return (
            <MyContext.Provider
                value={{
                    market_data: this.state.market_data,
                }}
            >
                {this.props.children}
            </MyContext.Provider>
        );
    }
}

export default MyProvider;
